import Layout from './Layout';
import Home from './pages/Home';
import Login from './pages/Login';
import Quiz from './pages/Quiz';
import Result from './pages/Result';
import Signup from './pages/Signup';
import './styles/App.css';

function App() {
  return (
    <div className="App">
      <Layout>
        <Home/>
        <Signup />
        <Login />
        <Quiz />
        <Result />
      </Layout>
    </div>
  );
}

export default App;
